// Get channel info from first item
const channelName = $input.first().json.snippet.localized.title;
const subscriberCount = $input.first().json.statistics.subscriberCount;

// Create videos array first
const videos = $input.all().map(item => ({
    title: item.json.snippet.title,
    views: item.json.statistics.viewCount,
    likes: item.json.statistics.likeCount,
    comments: item.json.statistics.commentCount
}));

// Create final output object with everything nested under "Stats"
const output = {
    Stats: {
        channelInfo: {
            name: channelName,
            subscribers: subscriberCount
        },
        videos: videos
    }
};

return output;

